import React from "react";
import pizzas from "../Pizzadata";
export default function Homepage() {
  return (
    <div>
      <div className="row">
        {pizzas.map((pizza) => {
          return (
            <div className="col md-4">
              <div pizza={pizza}></div>
            </div>
          );
        })}
      </div>
    </div>
  );
}
